import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Bg from './images/Bg.jpg';

function Homepage() {
  return (
    <div className="text-white font-serif font-extrabold bg-cover min-h-screen" style={{ backgroundImage: `url(${Bg})` }}>
      <div className="">
        <Header />
      </div>
        <p className="text-6xl pt-7 w-5 bg-cover rounded-t-full rounded-b-full ">Welcome to my Blog Post Web</p>
      <div className=" text-end">
        <h1 className="text-4xl">Chhon</h1>
        <h1 className="text-7xl">KimEang</h1>
        <p className="text-3xl">OW Student</p>
      </div>
      <div className=" align-bottom">
        <Footer />
      </div>
    </div>
  );
}

export default Homepage;
